import React from 'react';

function Section_coffee() {
	return (
		<figure id='coffee'>
			<div className='pic'>
				<div className='img'></div>
				<h1>
					FRESH
					<br />
					ROASTED BEANS
				</h1>
			</div>
			<div className='inner'></div>
		</figure>
	);
}

export default Section_coffee;
